    }

    componentDidMount() {
        window.jQuery = jQuery;
        console.log($("#stars"));

        require("../../public/js/vendor/flexBackground.js");
        $("#stars").flexBackground({
            numberOfPoints: "500",
			radius: "1",
			interval: "60",
			color: "rgb(250, 250, 250)"
        });
    }

    render() {
        return (
            <canvas id="stars">

            </canvas>
        );
    }
}

export default Stars;
